import { useParams } from "react-router-dom";
import useFetchData from "../apiFetches/FetchData";
import { BackButton } from "../components/BackButton";
import UserCard from "../components/UserCard";

const User = () => {
  const { user } = useParams();
  const apiData = useFetchData(`/users/${user}`);

  console.log(apiData);

  return (
    <>
      <BackButton />
      {apiData.loading ? <div>Loading</div> : <UserCard data={apiData.data} />}
    </>
  );
};
export default User;
